import React, { Component } from "react";

class ProjectCard extends Component {
  state = {};
  render() {
    return (
      <div className="card">
        <img
          className="card-img bg-blur bg-overlay"
          src={this.props.image}
          alt="Project"
        />
        <div className="card-img-overlay text-wrap">
          <h5 className="card-title">
            <span className="badge badge-warning">{this.props.title}</span>
          </h5>
          <p className="card-text text-justify text-monospace">
            <mark>{this.props.text}</mark>
          </p>
          <p className="card-text">
            {this.props.tags.map(tag => {
              return (
                <span key={tag} className="badge badge-info m-1">
                  {tag}
                </span>
              );
            })}
          </p>
        </div>
        <div className="card-footer">
          <a
            href={this.props.link}
            className="btn btn-dark"
            target="_blank"
            rel="noopener noreferrer"
          >
            Visit on GitHub
          </a>
        </div>
      </div>
    );
  }
}

export default ProjectCard;
